import React from 'react'

const NavigationLinks = () =>{
    return(
        <ul className = "flex justify-evenly items-center flex-grow mx-20">
            <li><a href='#info' className = "font-artistic text-3xl text-black transform motion-safe:hover:scale-110">Info</a></li>
            <h1 className = "transform hover:scale-110 motion-reduce:transform-none">dada</h1>
            <li><a href='#menu' className = "font-artistic text-3xl text-black">Menu</a></li>
            <li><a href='#reviews' className = "font-artistic text-3xl text-black">Reviews</a></li>
            <li><a href='#contact' className = "font-artistic text-3xl text-black">Contact</a></li>
        </ul>
    );
}

export default NavigationLinks;
